class Solution:
    def minTimeToVisitAllPoints(self, points: List[List[int]]) -> int:

        travel = 0
        start = points[0]
        i = 1
        end = points[i]
        curr = start

        while curr != end:
            if end[0] > curr[0]:
                curr[0] += 1
            elif end[0] < curr[0]:
                curr[0] -= 1
            if end[1] > curr[1]:
                curr[1] += 1
            elif end[1] < curr[1]:
                curr[1] -= 1
            travel += 1

            if curr == end:
                if i < len(points) -1 :
                    i += 1
                    end = points[i]
                else:
                    break

        return travel

