class Solution:
    def numberOfPairs(self, nums: List[int]) -> List[int]:

        singles = [0,0]
        tracker = {}

        for num in nums:
            if num not in tracker:
                tracker[num] = 1
            else:
                tracker[num] += 1

        for num in set(nums):
                singles[0] += tracker[num]//2
                singles[1] += tracker[num]%2

        return singles

