class Solution:
    def diStringMatch(self, s: str) -> List[int]:
        output = [0]
        for i,perm in enumerate(s):
            if perm == "I":
                output.append(output[i]+1)
            if perm == "D":
                output.append(output[i]-1)

        shift = min(output)
        output = [x + shift for x in output]

        return output

