        """
        :type words: List[str]
        :rtype: int
        """
        morseCode={}
        transformationS = []
        conversion = [".-","-...","-.-.","-..",".","..-.","--.","....","..",".---","-.-",".-..","--","-.","---",".--.","--.-",".-.","...","-","..-","...-",".--","-..-","-.--","--.."]

        for i in range(26):
            morseCode[i] = conversion[i]

        for word in words:
            transformation = ""
            for letter in word:
                transformation += morseCode[ord(letter)-ord('a')]
            transformationS.append(transformation)

        if len(words) == 1:
            return 1
        if len(words) == 0:
            return 0

        return (len(transformationS) - len(set(transformationS)))

class Solution(object):
    def numIdenticalPairs(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        uniquePairs = {}
        goodPairs = 0

        for i in range(len(nums)):
            if nums[i] in uniquePairs:
                uniquePairs[nums[i]] += 1
            else:
                uniquePairs[nums[i]] = 1

        for j in set(nums):
            x = uniquePairs[j]
            goodPairs += x*(x-1)*0.5

        return int(goodPairs)

