class Solution(object):
    def countConsistentStrings(self, allowed, words):
        """
        :type allowed: str
        :type words: List[str]
        :rtype: int
        """
        count = 0
        allowedchar = {}
        for i in allowed:
            allowedchar[i] = 0

        for word in words:
            count += 1
            for j in word:
                if j not in allowedchar:
                    count -= 1
                    break

        return count

