class Solution(object):
    def findMaxAverage(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: float
        """
        maxsum = sum(nums[:k])

        if len(nums) == k:
            return float(maxsum)/k

        for i in range(len(nums)-k+1):
            if sum(nums[i:i+k]) > maxsum:
                maxsum = sum(nums[i:i+k]) 

        return float(maxsum)/k

class Solution(object):
    def mySqrt(self, x):
        """
        :type x: int
        :rtype: int
        """
        left = 0
        right = x-1
        mid = 0

        while left <= right:

            mid = (left + right)//2

            if mid == left or mid ==right:
                return mid

            if mid*mid <x:
                left = mid
            if mid*mid >x:
                right = mid
            if mid*mid == x:
                return mid

        return mid

